To assist developers in implementing this functionality, the SDK package includes tutorials for C/C#/Java/VB.NET,
demonstrating how to generate serial numbers from a dongle. These tutorials can be found in the Tutorials\Licensing
folder (SerialNumberGenerationFromDongle). Typically, developers will call the serial number generation function/method from
NLicenseManager, which is part of the NLicensing library and facilitates license management tasks.
For example, in a C# application, the process may look like this:
//...
int sequenceNumber = int.Parse(args[0]);
uint productId = uint.Parse(args[1]);
int distributorId;
string serialNumber = NLicenseManager.GenerateSerial(productId, sequenceNumber, out
distributorId);
Console.WriteLine("serial number: {0}", serialNumber);
Console.WriteLine("distributor id: {0}", distributorId);

